import Link from 'next/link';

const Navbar = () => (
   <div className="container">
       <style global jsx>{`
             Link a {
                -webkit-transition: all 0.5s ease-out;
                -moz-transition: all 0.5s ease-out;
                -o-transition: all 0.5s ease-out;
                -ms-transition: all 0.5s ease-out;
                transition: all 0.5s ease-out;
            }
            nav {
                width: 250px;
                height:250px;
                text-align: center:
            }
            img {
                content-align:right;
            }
            nav 
            Link a {
                display: inline-block;
                text-decoration: none;
                color: #000;
                padding:25px 25px;
            }
            Link  a:hover {
                color: #23527c;
            }
        `}</style> 
        <nav>
            <p>Siphosethu Gajana's Portfolio</p>
            <img src='./static/Profile.JPG' alt='profileImage'/> 
            <Link href="/">Home</Link>
            <Link href="/about">
                <a>About</a>
            </Link>
            <Link href="/projects">
                <a>Projects</a> 
            </Link>
            <Link href="/contact">
                <a>Contact</a>  
            </Link>
            
        </nav>
    </div>
)
export default Navbar;
